import React from 'react';
import { StyleSheet, SafeAreaView, SectionList, Button, Alert, } from "react-native";

import { Text, View } from '../components/Themed';
import { RootTabScreenProps } from '../types';

import { Data } from '../data/FGList'
import { StatusBar } from 'expo-status-bar';

import ListItem, { Separator } from '../components/ListItems';

const Item = ({ title }) => (
  <View style={styles.item}>
    <Text style={styles.title}>{title}</Text>
  </View>
);

const TabOneScreen = ({ navigation }: RootTabScreenProps<'TabOne'>) => (
  <SafeAreaView style={styles.container}>
    <SectionList
      sections={Data}
      keyExtractor={(item, index) => item + index}
      //renderItem={({ item }) => <Item title={item} />}
      renderItem={({ item }) => (
        <ListItem
          {...item}
          onSwipeFromLeft={() => alert('swiped from left!')}
          onRightPress={() => alert('pressed right!')}
        />
      )}
      renderSectionHeader={({ section: { title } }) => (
        <Text style={styles.header}>{title}</Text>
      )}
      ItemSeparatorComponent={() => <Separator />}
    />
    <Button
        title="Add food"
        color="#f194ff"
        onPress={() => Alert.alert('Recipe scanned! Food added.')}
    />
  </SafeAreaView>
);

// Style
const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    paddingTop: StatusBar.currentHeight,
    marginHorizontal: 16
  },
  item: {
    backgroundColor: "#b5c4b1",
    padding: 20,
    marginVertical: 3
  },
  header: {
    fontSize: 25,
    backgroundColor: "#bfbfbf"
  },
  title: {
    fontSize: 12
  }
});

export default TabOneScreen;
